window.createCamera = function (cameraSettings) {
  // console.log('createCamera', cameraSettings);

  var right = cameraSettings.width / 2;
  var top = cameraSettings.height / 2;
  var camera = new THREE.OrthographicCamera(-right, right, top, -top, 1, 2000);
  camera.position.x = 300;
  camera.position.z = 40;
  camera.zoom = cameraSettings.zoom;
  camera.updateProjectionMatrix();

  return camera;
};

window.updateCamera = function (camera, cameraSettings) {
  // console.log('updateCamera', camera, cameraSettings);

  camera.right = cameraSettings.width / 2;
  camera.top = cameraSettings.height / 2;
  camera.left = -camera.right;
  camera.bottom = -camera.top;
  camera.zoom = cameraSettings.zoom;
  camera.updateProjectionMatrix();
};
window.VexorTextureShader = {
  uniforms: {
    time: { value: 1.4 },
    threshold: { value: 0.1 },
  },

  vertexShader: [
    'varying vec2 vUv;',
    'void main() {',
    '  vUv = uv;',
    '  vec4 mvPosition = modelViewMatrix * vec4( position, 1.0 );',
    '  gl_Position = projectionMatrix * mvPosition;',
    '}'
  ].join("\n"),

  fragmentShader: [
    'uniform float time;',
    'uniform float threshold;',
    'varying vec2 vUv;',
    'void main( void ) {',
    '  vec2 position = vUv;',
    '  float color_1_r = 0.2;',
    '  float color_1_g = 0.2;',
    '  float color_1_b = 0.6;',
    '  float color_2_r = 0.42;',
    '  float color_2_g = 0.86;',
    '  float color_2_b = 0.74;',
    '  float pi = 3.1415926535897932384626433832795;',
    '  float f_line = sin((position.x - 0.08 * position.y) * pi * 200.0 - time);',
    '  float k = 0.0;',
    '  if (f_line < 0.0) {',
    '    k = -1.0;',
    '  } else {',
    '    k = 1.0;',
    '  }',
    '  float f_line_a = abs(f_line);',
    '  float sk = 0.0;',
    '  if (f_line_a < threshold) {',
    '    sk = (threshold - f_line_a) / threshold;',
    '    k = f_line * sk + k * (1.0 - sk);',
    '  }',
    '  k = (k + 1.0) / 2.0;',
    '  float color_r = color_1_r + (color_2_r - color_1_r) * k;',
    '  float color_g = color_1_g + (color_2_g - color_1_g) * k;',
    '  float color_b = color_1_b + (color_2_b - color_1_b) * k;',
    '  gl_FragColor = vec4(vec3(color_r, color_g, color_b), 1.0);',
    '}'
  ].join("\n")
};

function CustomSinCurve(scale) {
  THREE.Curve.call(this);
  this.scale = (scale === undefined) ? 1 : scale;
}

CustomSinCurve.prototype = Object.create(THREE.Curve.prototype);

CustomSinCurve.prototype.constructor = CustomSinCurve;

CustomSinCurve.prototype.getPoint = function (t) {
  t = (Math.PI * 2) * t;
  var s = Math.sin(t);
  var c = Math.cos(t);
  var r = 2 + 6 * c;
  var ty = 1 + (-r * c) * 0.205 - 0.25;
  var tx = (-r * s) * 0.205;
  var tz = s * 0.65;

  return new THREE.Vector3(tx, ty, tz).multiplyScalar(this.scale);
};

window.createFigure = function () {
  var path = new CustomSinCurve(20);
  var geometry = new THREE.TubeGeometry(path, 200, 6, 100, true);
  var shaderMaterial = new THREE.ShaderMaterial(VexorTextureShader);

  return new THREE.Mesh(geometry, shaderMaterial);
};
window.createRenderer = function (containerSize, pixelRatio) {
  var renderer = new THREE.WebGLRenderer({ antialias: true, alpha: true });

  updateRenderer(renderer, containerSize, pixelRatio);
  renderer.shadowMap.enabled = false;
  renderer.gammaInput = false;
  renderer.gammaOutput = false;

  return renderer;
};

window.updateRenderer = function (renderer, containerSize, pixelRatio) {
  renderer.setPixelRatio(pixelRatio);
  renderer.setSize(containerSize.width, containerSize.height);
};
window.createScene = function (figure) {
  var scene = new THREE.Scene();
  var group = new THREE.Group();
  // scene.background = new THREE.Color(0x333399);
  scene.add(group);
  group.add(figure);
  return { group: group, scene: scene };
};






window.pipe1 = null;
window.pipe2 = null;

var mousePos = {
  x: 0,
  y: 0,
  dx: 0,
  dy: 0,
  timestamp: 0,
};

var $window = $(window);

$(init);

$window.on('mousemove', function (event) {
  if (mousePos.timestamp !== 0 && (mousePos.x !== 0 || mousePos.y !== 0)) {
    var dx = event.pageX - mousePos.x;
    var dy = event.pageY - mousePos.y;
    var dt = Math.max(window.animationTimestamp - mousePos.timestamp, 10);
    if (Math.abs(dx) < 500 && Math.abs(dy) < 400) {
      mousePos.dx += dx / dt;
      mousePos.dy += dy / dt;
      // console.log(dx, dy, dt, Math.round(mousePos.dx), Math.round(mousePos.dy));
    }
  }
  mousePos.x = event.pageX;
  mousePos.y = event.pageY;
  if (window.animationTimestamp) {
    mousePos.timestamp = window.animationTimestamp;
  }
});

